/***************** GLOBAL - Variables, Keyframes & Scroll JS  *****************/

:root {
    --size-100: 6.250em;
    --size-48: 3.2em;
    --size-40: 2.5em;
    --size-32: 2em;
    --size-24: 1.5em;
    --size-22: 1.375em;
    --size-20: 1.25em;
    --size-18: 1.125em;
    --size-16: 1em;
    --size-14: 0.875em;
    --color-bg: #fff;
    --color-black: #172633;
    --color-red: #ff3e3e;
    --color-grey: #b3b3b3;
    --space-220: 13.75em;
    --space-64: 4em;
    --space-48: 3em;
    --space-24: 1.5em;
    --space-16: 1em;
    --space-12: 0.75em;
    --font-serif: "big-caslon-fb", serif;
    --font-sans: "neue-haas-unica", sans-serif;
    --weight-reg: 400;
    --weight-bold: 600;
    --weight-black: 900;


}

/************ Keyframes *************/

.wordContainer {
    overflow: hidden;
}

@keyframes up {
    100% {
       transform: translateY(-5%);
    }
 }

 .word {
    animation: up 0.8s;
    animation-delay: 0.5s;
    animation-fill-mode: forwards;
    animation-timing-function: cubic-bezier(0.075, 0.82, 0.165, 1);
    transform: translateY(115%);
 }
 .wordContainer:nth-child(1) .word { 
    animation-delay: 0.5s;
 }
 .wordContainer:nth-child(2) .word { 
    animation-delay: 0.8s;
 }
 .wordContainer:nth-child(3) .word { 
    animation-delay: 1s;
 }
 .wordContainer:nth-child(4) .word { 
    animation-delay: 1.65s;
 }
 .wordContainer:nth-child(5) .word { 
    animation-delay: 1.65s;
 }
 .wordContainer:nth-child(6) .word { 
    animation-delay: 1.65s;
 }
 .wordContainer:nth-child(7) .word { 
    animation-delay: 1.65s;
 }


/************** On Scroll Animation ***************/

[data-scroll] {
    transition: all ease 0.8s;
}

[data-scroll="in"] {
    opacity: 1;
    transform: translateY(0);
}

[data-scroll="out"] {
    opacity: 0;
    transform: translateY(60px);
}







a {
